import React, { useState, useEffect } from 'react';
import { supabase } from '../lib/supabaseClient';
import { useNavigate } from 'react-router-dom';
import '../styles/style.css';

const UserPreferences = () => {
  const [preferences, setPreferences] = useState({
    first_name: '',
    last_name: '',
    birthdate: null,
    city: '',
    has_HVAC: false,
    has_ecologgica: false,
    anxiety_base_level: 5, // Default middle value
    track_anxiety: false,
    has_children: false,
    children_details: '',
    has_pets: false,
    pets_details: '',
    allergies: [],
    health_issues: [],
    activity_level: 5, // Default middle value
    sleep_level: 'moderate' // Will be mapped to numeric values
  });

  const [isLoading, setIsLoading] = useState(true);
  const navigate = useNavigate();

  // Map sleep quality levels to numeric values
  const sleepQualityMap = {
    'low': 2,
    'moderate': 5,
    'high': 9
  };

  const sleepQualityOptions = [
    { value: 'low', label: 'Low' },
    { value: 'moderate', label: 'Moderate' },
    { value: 'high', label: 'High' }
  ];

  useEffect(() => {
    fetchPreferences();
  }, []);

  const fetchPreferences = async () => {
    try {
      const { data: { user }, error: userError } = await supabase.auth.getUser();

      if (userError) throw userError;

      if (!user) {
        navigate('/login');
        return;
      }

      const { data, error } = await supabase
        .from('user_preferences')
        .select('*')
        .eq('user_id', user.id)
        .single();

      if (error) throw error;

      if (data) {
        // Convert any null values to defaults
        setPreferences({
          ...preferences,
          ...data,
          anxiety_base_level: data.anxiety_base_level || 5,
          activity_level: data.activity_level || 5,
          allergies: data.allergies || [],
          health_issues: data.health_issues || []
        });
      }
    } catch (error) {
      console.error('Error fetching preferences:', error.message);
    } finally {
      setIsLoading(false);
    }
  };

  const handleSave = async (e) => {
    e.preventDefault();

    try {
      const { data: { user }, error: userError } = await supabase.auth.getUser();

      if (userError) throw userError;

      if (!user) {
        alert('Please log in to save preferences');
        navigate('/login');
        return;
      }

      // Prepare the data for saving
      const dataToSave = {
        ...preferences,
        user_id: user.id,
        updated_at: new Date().toISOString()
      };

      const { error } = await supabase
        .from('user_preferences')
        .upsert(dataToSave, {
          onConflict: 'user_id'
        });

      if (error) throw error;

      alert('Profile updated successfully!');
      navigate('/dashboard');
    } catch (error) {
      console.error('Error saving preferences:', error.message);
      alert('Error updating profile: ' + error.message);
    }
  };

  if (isLoading) {
    return <div>Loading...</div>;
  }

  return (
    <div className="preferences-container">
      <div className="preferences-content">
        <h1 className="preferences-title">Profile</h1>

        <form onSubmit={handleSave} className="preferences-form">
          <div className="form-row">
            <div className="form-group">
              <label>First Name</label>
              <input
                type="text"
                value={preferences.first_name}
                onChange={(e) => setPreferences({ ...preferences, first_name: e.target.value })}
                className="form-input"
                placeholder="Enter first name"
              />
            </div>

            <div className="form-group">
              <label>Last Name</label>
              <input
                type="text"
                value={preferences.last_name}
                onChange={(e) => setPreferences({ ...preferences, last_name: e.target.value })}
                className="form-input"
                placeholder="Enter last name"
              />
            </div>
          </div>

          <div className="form-row">
            <div className="form-group">
              <label>Birthdate</label>
              <input
                type="date"
                value={preferences.birthdate || ''}
                onChange={(e) => setPreferences({ ...preferences, birthdate: e.target.value })}
                className="form-input"
              />
            </div>

            <div className="form-group">
              <label>City</label>
              <input
                type="text"
                value={preferences.city}
                onChange={(e) => setPreferences({ ...preferences, city: e.target.value })}
                className="form-input"
                placeholder="Enter city"
              />
            </div>
          </div>

          <div className="form-row">
            <div className="form-group">
              <label>Anxiety Base Level: {preferences.anxiety_base_level}</label>
              <input
                type="range"
                min="1"
                max="10"
                value={preferences.anxiety_base_level}
                onChange={(e) => setPreferences({ ...preferences, anxiety_base_level: parseInt(e.target.value) })}
                className="form-slider"
              />
            </div>

            <div className="form-group">
              <label>Activity Level: {preferences.activity_level}</label>
              <input
                type="range"
                min="1"
                max="10"
                value={preferences.activity_level}
                onChange={(e) => setPreferences({ ...preferences, activity_level: parseInt(e.target.value) })}
                className="form-slider"
              />
            </div>
          </div>

          <div className="form-row">
            <div className="form-group">
              <label>Sleep Quality</label>
              <select
                value={preferences.sleep_level}
                onChange={(e) => setPreferences({ ...preferences, sleep_level: e.target.value })}
                className="form-select"
              >
                {sleepQualityOptions.map(option => (
                  <option key={option.value} value={option.value}>
                    {option.label}
                  </option>
                ))}
              </select>
            </div>
          </div>

          <div className="form-group checkbox-group">
            <label className="checkbox-label">
              <input
                type="checkbox"
                checked={preferences.has_HVAC}
                onChange={(e) => setPreferences({ ...preferences, has_HVAC: e.target.checked })}
              />
              I have an HVAC system
            </label>
          </div>

          <div className="form-group checkbox-group">
            <label className="checkbox-label">
              <input
                type="checkbox"
                checked={preferences.has_ecologgica}
                onChange={(e) => setPreferences({ ...preferences, has_ecologgica: e.target.checked })}
              />
              I have an Ecologica air purifier
            </label>
          </div>

          <div className="form-group checkbox-group">
            <label className="checkbox-label">
              <input
                type="checkbox"
                checked={preferences.track_anxiety}
                onChange={(e) => setPreferences({ ...preferences, track_anxiety: e.target.checked })}
              />
              Track my anxiety levels
            </label>
          </div>

          <div className="form-group checkbox-group">
            <label className="checkbox-label">
              <input
                type="checkbox"
                checked={preferences.has_children}
                onChange={(e) => setPreferences({ ...preferences, has_children: e.target.checked })}
              />
              I have children
            </label>
          </div>

          {preferences.has_children && (
            <div className="form-group">
              <label>Children Details</label>
              <textarea
                value={preferences.children_details}
                onChange={(e) => setPreferences({ ...preferences, children_details: e.target.value })}
                className="form-input"
                placeholder="Enter details about your children (ages, etc.)"
              />
            </div>
          )}

          <div className="form-group checkbox-group">
            <label className="checkbox-label">
              <input
                type="checkbox"
                checked={preferences.has_pets}
                onChange={(e) => setPreferences({ ...preferences, has_pets: e.target.checked })}
              />
              I have pets
            </label>
          </div>

          {preferences.has_pets && (
            <div className="form-group">
              <label>Pet Details</label>
              <textarea
                value={preferences.pets_details}
                onChange={(e) => setPreferences({ ...preferences, pets_details: e.target.value })}
                className="form-input"
                placeholder="Enter details about your pets (type, breed, etc.)"
              />
            </div>
          )}

          <button type="submit" className="save-button">
            Save Changes
          </button>
        </form>
      </div>
    </div>
  );
};

export default UserPreferences;
